pub fn deinterleave(self, other: Self) -> (Self, Self) {
        let (even, odd) = self.to_int().deinterleave(other.to_int());
        // Safety: swizzles are safe for masks
        unsafe {
            (
                Self::from_int_unchecked(even),
                Self::from_int_unchecked(odd),
            )
        }
    }
